import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { useAuth } from "../../context/AuthContext";

function TeacherDashboard() {
  const { logout } = useAuth();
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);
  const [stats, setStats] = useState({ studentsHelped: 0, activeConsultations: 0, avgRating: 0 });
  const navigate = useNavigate();

  useEffect(() => {
    async function fetchStats() {
      // Simulated API call (Replace with real API)
      const data = { studentsHelped: 152, activeConsultations: 12, avgRating: 4.8 };
      setStats(data);
    }
    fetchStats();
  }, []);

  const toggleSidebar = () => setIsSidebarOpen(!isSidebarOpen);
  const closeSidebar = () => setIsSidebarOpen(false);
  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  return (
    <div className="dashboard-container">
      {/* Sidebar Toggle Button */}
      <button className="menu-btn" onClick={toggleSidebar}>‚ò∞</button>

      {/* Sidebar & Overlay */}
      {isSidebarOpen && <div className="sidebar-overlay show" onClick={closeSidebar}></div>}
      <div className={`sidebar ${isSidebarOpen ? "open" : ""}`}>
        <div className="sidebar-header">
          <h3 className="text-light">Teacher Panel</h3>
          <button className="close-btn" onClick={closeSidebar}>√ó</button>
        </div>
        <button className="sidebar-btn" onClick={() => navigate("/teacher-consultations")}>View Consultations</button>
        <button className="sidebar-btn" onClick={() => navigate("/student-requests")}>Student Requests</button>
        <button className="sidebar-btn" onClick={() => navigate("/teacher-profile")}>My Profile</button>
        <div className="logout-container">
          <button className="logout-btn" onClick={handleLogout}>Logout</button>
        </div>
      </div>

      {/* Main Content */}
      <div className="container mt-5">
        <h2 className="text-center text-light-blue">Welcome, Teacher!</h2>
        <p className="text-center text-muted">Manage consultations, student requests, and your profile.</p>

        {/* Teacher Statistics Section */}
        <div className="row mt-4">
          <div className="col-md-4">
            <div className="dashboard-card">
              <h4>üë®‚Äçüéì Students Helped</h4>
              <p className="count">{stats.studentsHelped}</p>
            </div>
          </div>
          <div className="col-md-4">
            <div className="dashboard-card">
              <h4>üìÖ Active Consultations</h4>
              <p className="count">{stats.activeConsultations}</p>
            </div>
          </div>
          <div className="col-md-4">
            <div className="dashboard-card">
              <h4>‚≠ê Avg. Rating</h4>
              <p className="count">{stats.avgRating} / 5</p>
            </div>
          </div>
        </div>
      </div>

      {/* Styles - Updated to Black, White & Light Blue Theme */}
      <style>
        {`
          /* Dashboard Layout */
          .dashboard-container {
            position: relative;
            background: #f4f6f9;
            min-height: 100vh;
            padding-top: 20px;
          }

          /* Sidebar */
          .menu-btn {
            position: fixed;
            top: 10px;
            left: 15px;
            background: #222;
            color: white;
            border: none;
            padding: 10px 15px;
            font-size: 18px;
            cursor: pointer;
            border-radius: 5px;
            z-index: 1100;
            transition: all 0.3s ease-in-out;
          }
          .menu-btn:hover {
            background: #0056b3;
          }

          .sidebar {
            position: fixed;
            top: 0;
            left: -270px;
            width: 270px;
            height: 100%;
            background: #1c1c1c;
            padding: 20px;
            transition: left 0.3s ease-in-out;
            z-index: 1000;
            display: flex;
            flex-direction: column;
            justify-content: space-between;
            box-shadow: 4px 0 10px rgba(0, 0, 0, 0.3);
          }
          .sidebar.open {
            left: 0;
          }

          .sidebar-header {
            display: flex;
            justify-content: space-between;
            align-items: center;
          }
          .close-btn {
            background: none;
            border: none;
            color: white;
            font-size: 24px;
            cursor: pointer;
          }

          .sidebar-overlay {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(0, 0, 0, 0.5);
            z-index: 999;
            display: none;
          }
          .sidebar-overlay.show {
            display: block;
          }

          /* Sidebar Buttons */
          .sidebar-btn {
            background: #0056b3;
            color: white;
            border: none;
            padding: 12px;
            font-size: 16px;
            width: 100%;
            border-radius: 5px;
            margin-top: 10px;
            cursor: pointer;
            transition: all 0.3s ease-in-out;
          }
          .sidebar-btn:hover {
            background: #007bff;
          }

          .logout-container {
            margin-top: auto;
          }
          .logout-btn {
            background: #dc3545;
            color: white;
            border: none;
            padding: 12px;
            font-size: 16px;
            width: 100%;
            border-radius: 5px;
            cursor: pointer;
          }
          .logout-btn:hover {
            background: #c82333;
          }

          /* Dashboard Cards */
          .dashboard-card {
            background: white;
            padding: 20px;
            border-radius: 10px;
            box-shadow: 0 4px 10px rgba(0, 0, 0, 0.1);
            text-align: center;
            transition: transform 0.3s ease-in-out, box-shadow 0.3s ease-in-out;
          }
          .dashboard-card:hover {
            transform: translateY(-5px);
            box-shadow: 0 6px 15px rgba(0, 0, 0, 0.2);
          }
          .dashboard-card h4 {
            font-size: 18px;
            font-weight: 600;
            color: #333;
          }
          .dashboard-card .count {
            font-size: 24px;
            font-weight: bold;
            color: #0056b3;
            margin-top: 10px;
          }

          /* Responsive Layout */
          @media (max-width: 768px) {
            .sidebar {
              width: 100%;
            }
          }
          @media (max-width: 576px) {
            .row {
              flex-direction: column;
              align-items: center;
            }
            .col-md-4 {
              width: 80%;
              margin-bottom: 15px;
            }
          }
        `}
      </style>
    </div>
  );
}

export default TeacherDashboard;
